import React from 'react';
import './App.css';
import CardList from './CardList';
import {robots} from './robots';


function App({}) {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Robo Apps</h1>
      </header>
      <CardList robots={robots} />
    </div>
  );
}

export default App;
